import React, { useState } from 'react';
import email from "./Components/email.png";
import pass from "./Components/password.png";
import './login.css'; // optional if you have styles

const login = () => {

const [action,setAction] = useState("Login");

  return (
    <div className="container">
      <div className="header">
        <div className="text">{action}</div>
        <div className="underline"></div>
      </div>
      <div className="inputs">
        <div className="input">
          <img src={email} alt="email icon"   />
          <input type="email" placeholder="Email ID" />
        </div>
        <div className="input">
          <img src={pass} alt="password icon" />
          <input type="password" placeholder="Password" />
        </div>
      </div>
      <div className="forgetpass">Forgot Password? <span>Click here!  </span></div>
      <div className="submit-container">
        <div className={action==="Login"?"submit gray":"submit"}>Sign up</div>
        <div className={action==="sign up"?"submit gray":"submit"}>Login</div>
      </div>
    </div>
  );
};

export default login;
